NETWORKS = []
DECIMALS = {}
CONNEXT = {}
RPCS = {}
for i in CHAINS:
    assets = {}
    chain_id = i['chain_id']
    if str(chain_id) not in CONFIG:
        continue
    chainName = i["title"]
    for token in TOKENS:
        for token_chain in token["contracts"]:
            if token_chain["chain_id"] == chain_id:
                assets[token["symbol"]] = token_chain["contract_address"]
                DECIMALS[(chainName, token["symbol"])] = token_chain["contract_decimals"]
                DECIMALS[(str(chain_id), token["symbol"])] = token_chain["contract_decimals"]
    NETWORKS.append({"chainName":chainName, "chainId":chain_id, 'assets':assets})
    CONNEXT[chainName] = list(CONFIG[str(chain_id)].values())[0]["contracts"]["TransactionManager"]["address"]
    RPCS[chainName] = [url for url in i['provider_params'][0]["rpcUrls"] if url.startswith("https://")]

Router = "0x29a519e21d6a97cdb82270b69c98bac6426cdcf9"
liquidity={} #("xDAI", "USDC"): 100.1

for chain in NETWORKS:
    rpcs = chain2rpcs(chain["chainId"])
    if rpcs is None:
        rpcs = RPCS[chain["chainName"]]
    x=Endpoint_Provider(rpcs)
    #chainname = chainid2name(chain["chainId"])
    chainname = chain["chainName"]
    #print(chainname, chain)
    datalist = []
    idx2name = {}
    idx = 0
    for name, addr in chain["assets"].items():
        datalist.append([CONNEXT[chainname], "routerBalances(address,address)", toarg(Router)+toarg(addr)])
        idx2name[idx] = name
        idx += 1
    for idx, bal in enumerate(x.batch_callfunction_decode(datalist, ["uint256"])):
        liquidity[str(chain["chainId"]), idx2name[idx]] = bal/10**DECIMALS[chainname, idx2name[idx]]


from web3.auto import w3
from eth_account.messages import encode_defunct
from eth_account.messages import defunct_hash_message
from base64 import *
from common import *
import os
privatekey = os.urandom(32)
addr = w3.eth.account.privateKeyToAccount(privatekey).address
nonce = sess.get("https://auth.connext.network/auth/"+addr).text.strip()
msg="""Hi there from Connext! Sign this message to make sure that no one can communicate on the Connext Network on your behalf. This will not cost you any Ether!
  
To stop hackers from using your wallet, here's a unique message ID that they can't guess: """+nonce
sig = w3.eth.account.sign_message(encode_defunct(text=msg), private_key=privatekey).signature.hex()
#sig = w3.eth.account.signHash(defunct_hash_message(msg.encode("utf-8")), private_key=privatekey).signature.hex()
x = sess.post("https://auth.connext.network/auth", json={"sig":sig, "signerAddress":addr})
assert x.status_code == 200, x.text
auth = x.text.strip()
from websocket import create_connection
import websocket
ws = create_connection("wss://websocket.connext.provide.network/")
ws.recv()
ws.send("""CONNECT {"lang":"javascript","pedantic":false,"protocol":1,"verbose":false,"jwt":"AUTH","name":"ts-natsutil-8b84f3ac-b2e4-486d-9272-0e023f66d3ad","noEcho":false,"url":"wss://websocket.connext.provide.network","userJWT":"AUTH","payload":"string"}\r\n""".replace("AUTH", auth))
ws.send("""SUB ADDR.*.auction.response 1\r\n""".replace("ADDR", addr))
ws.send("PING\r\n")
print(ws.recv())

def randhex(n=64):
    return "0x"+"".join([random.choice("01234567890abcdef") for _ in range(n)])

index2contract = {}
for c1 in NETWORKS:
    for c2 in NETWORKS:
        if c1==c2:
            continue
        #c1name, c2name = chainid2name(c1["chainId"]), chainid2name(c2["chainId"])
        c1id, c2id = c1["chainId"], c2["chainId"]
        for srctoken, srctoken_contract in c1["assets"].items():
            if srctoken not in c2["assets"]:
                continue
            dsttoken_contract = c2["assets"][srctoken]
            index = f"{c1id}_{srctoken}_{c2id}"
            index2contract[index] = [srctoken_contract, dsttoken_contract]
            amount = 100
            if "USD" not in srctoken:
                amount = 0.1
            query = json.dumps({
                "responseInbox":index,
                "data":{
                    "user":addr,
                    "initiator":addr,
                    "sendingChainId": c1["chainId"],
                    "sendingAssetId": srctoken_contract,
                    "amount":str(int(amount*10**DECIMALS[c1["chainName"], srctoken])),
                    "receivingChainId": c2["chainId"],
                    "receivingAssetId": dsttoken_contract,
                    "receivingAddress":addr,
                    "callTo":"0x0000000000000000000000000000000000000000",
                    "callDataHash":"0xc5d2460186f7233c927e7db2dcc703c0e500b653ca82273b7bfad8045d85a470",
                    "encryptedCallData":"0x",
                    "expiry":int(time.time()+86400),
                    "transactionId":randhex(64),
                    "dryRun":False
                },"version":"0.0.1","error":None})
            ws.send(f"PUB {addr}.{addr}.auction.request {len(query)}\r\n{query}\r\n")
ws.settimeout(10)
allresp = []
while True:
    try:
        resp = ws.recv().decode()
    except websocket._exceptions.WebSocketTimeoutException:
        break
    if resp.strip()=="PING":
        ws.send("PONG\r\n")
        continue
    allresp.append(resp)

tmp = {}
res=[HEADER]
for item in "".join(allresp).split("\r\n"):
    if item.startswith("MSG ") or not item:
        continue
    d = json.loads(item)
    if d["error"]:
        print("error", d)
        continue
    index = d["responseInbox"]
    srcchain, token, dstchain = index.split("_")
    decimal = DECIMALS[dstchain, token]
    received = float(d["data"]["bid"]["amountReceived"])/10**decimal
    if "gasFeeInReceivingToken" in d["data"]:
        gasfee = float(d["data"]["gasFeeInReceivingToken"])/10**decimal
    else:
        gasfee = 0
    percent = round((1-(gasfee+received)/100)*100, 3)
    key = (srcchain, dstchain, token)
    value1 = ["xpollinatev2", chainid2name(srcchain), token, chainid2name(dstchain), token, index2contract[index][0], index2contract[index][1], "", "", True, gasfee, percent, 0, -1, 0, liquidity[dstchain, token], ""]
    if key not in tmp or tmp[key][0]<received:
        tmp[key] = [received, value1]

for item in tmp.values():
    res.append(item[1])
writecsv("xpollinatev2.txt", res)